import { css } from "@emotion/css";

const Resume = () => {
  return (
    <div
      className={css`
        width: 100%;
        position: relative;
        background-color: #fff;
        height: 842px;
        overflow-x: auto;
        text-align: left;
        font-size: 7px;
        color: #334155;
        font-family: "Plus Jakarta Sans";
      `}
    >
      <div
        className={css`
          position: absolute;
          width: 100%;
          top: 0px;
          right: 0%;
          left: 0%;
          background-color: #fff;
          height: 842px;
        `}
      >
        <div
          className={css`
            position: absolute;
            top: 0px;
            left: -3px;
            width: 595px;
            height: 160px;
          `}
        >
          <header
            className={css`
              position: absolute;
              top: 0px;
              left: 0px;
              display: flex;
              flex-direction: column;
              align-items: flex-start;
              justify-content: flex-start;
              gap: 10px 0px;
              text-align: left;
              font-size: 28px;
              color: #334155;
              font-family: "Plus Jakarta Sans";
            `}
          >
            <div
              className={css`
                width: 595px;
                position: relative;
                height: 160px;
                overflow: hidden;
                flex-shrink: 0;
                z-index: 0;
              `}
            >
              <img
                className={css`
                  position: absolute;
                  top: -235px;
                  left: -116px;
                  width: 815.64px;
                  height: 422.8px;
                  object-fit: contain;
                  opacity: 0.92;
                `}
                alt=""
                src="/gradient.svg"
              />
              <div
                className={css`
                  position: absolute;
                  top: 0px;
                  left: 0px;
                  width: 595px;
                  height: 160px;
                `}
              >
                <div
                  className={css`
                    position: absolute;
                    top: -0.25px;
                    left: -0.25px;
                    border-top: 0.5px dashed rgba(255, 255, 255, 0.2);
                    box-sizing: border-box;
                    width: 595.5px;
                    height: 0.5px;
                  `}
                />
                <div
                  className={css`
                    position: absolute;
                    top: 14.3px;
                    left: -0.25px;
                    border-top: 0.5px dashed rgba(255, 255, 255, 0.2);
                    box-sizing: border-box;
                    width: 595.5px;
                    height: 0.5px;
                  `}
                />
                <div
                  className={css`
                    position: absolute;
                    top: 28.84px;
                    left: -0.25px;
                    border-top: 0.5px dashed rgba(255, 255, 255, 0.2);
                    box-sizing: border-box;
                    width: 595.5px;
                    height: 0.5px;
                  `}
                />
                <div
                  className={css`
                    position: absolute;
                    top: 43.39px;
                    left: -0.25px;
                    border-top: 0.5px dashed rgba(255, 255, 255, 0.2);
                    box-sizing: border-box;
                    width: 595.5px;
                    height: 0.5px;
                  `}
                />
                <div
                  className={css`
                    position: absolute;
                    top: 57.93px;
                    left: -0.25px;
                    border-top: 0.5px dashed rgba(255, 255, 255, 0.2);
                    box-sizing: border-box;
                    width: 595.5px;
                    height: 0.5px;
                  `}
                />
                <div
                  className={css`
                    position: absolute;
                    top: 72.48px;
                    left: -0.25px;
                    border-top: 0.5px dashed rgba(255, 255, 255, 0.2);
                    box-sizing: border-box;
                    width: 595.5px;
                    height: 0.5px;
                  `}
                />
                <div
                  className={css`
                    position: absolute;
                    top: 87.02px;
                    left: -0.25px;
                    border-top: 0.5px dashed rgba(255, 255, 255, 0.2);
                    box-sizing: border-box;
                    width: 595.5px;
                    height: 0.5px;
                  `}
                />
                <div
                  className={css`
                    position: absolute;
                    top: 101.57px;
                    left: -0.25px;
                    border-top: 0.5px dashed rgba(255, 255, 255, 0.2);
                    box-sizing: border-box;
                    width: 595.5px;
                    height: 0.5px;
                  `}
                />
                <div
                  className={css`
                    position: absolute;
                    top: 116.11px;
                    left: -0.25px;
                    border-top: 0.5px dashed rgba(255, 255, 255, 0.2);
                    box-sizing: border-box;
                    width: 595.5px;
                    height: 0.5px;
                  `}
                />
                <div
                  className={css`
                    position: absolute;
                    top: 130.66px;
                    left: -0.25px;
                    border-top: 0.5px dashed rgba(255, 255, 255, 0.2);
                    box-sizing: border-box;
                    width: 595.5px;
                    height: 0.5px;
                  `}
                />
                <div
                  className={css`
                    position: absolute;
                    top: 145.2px;
                    left: -0.25px;
                    border-top: 0.5px dashed rgba(255, 255, 255, 0.2);
                    box-sizing: border-box;
                    width: 595.5px;
                    height: 0.5px;
                  `}
                />
                <div
                  className={css`
                    position: absolute;
                    top: 159.75px;
                    left: -0.25px;
                    border-top: 0.5px dashed rgba(255, 255, 255, 0.2);
                    box-sizing: border-box;
                    width: 595.5px;
                    height: 0.5px;
                  `}
                />
              </div>
              <img
                className={css`
                  position: absolute;
                  top: 0px;
                  left: 0px;
                  width: 592px;
                  height: 176px;
                `}
                alt=""
                src="/linehorizontal.svg"
              />
              <div
                className={css`
                  position: absolute;
                  top: 0px;
                  left: 0px;
                  background: linear-gradient(
                    180deg,
                    rgba(255, 255, 255, 0),
                    #fff
                  );
                  width: 595px;
                  height: 160px;
                `}
              />
              <div
                className={css`
                  position: absolute;
                  top: 159.75px;
                  left: -0.25px;
                  border-top: 0.5px solid #e2e8f0;
                  box-sizing: border-box;
                  width: 595.5px;
                  height: 0.5px;
                `}
              />
            </div>
            <div
              className={css`
                margin: 0 !important;
                position: absolute;
                bottom: 14px;
                left: 185px;
                height: 105px;
                display: flex;
                flex-direction: column;
                align-items: center;
                justify-content: flex-start;
                z-index: 1;
              `}
            >
              <div
                className={css`
                  display: flex;
                  flex-direction: column;
                  align-items: center;
                  justify-content: flex-start;
                  padding: 0px 6px;
                  position: relative;
                  gap: 10px 0px;
                `}
              >
                <div
                  className={css`
                    display: flex;
                    flex-direction: column;
                    align-items: center;
                    justify-content: flex-start;
                    gap: 4px 0px;
                    z-index: 0;
                  `}
                >
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: flex-start;
                      justify-content: flex-start;
                    `}
                  >
                    <div
                      className={css`
                        position: relative;
                        font-weight: 800;
                      `}
                    >
                      Ghulam Mujtaba
                    </div>
                  </div>
                  <div
                    className={css`
                      display: flex;
                      flex-direction: row;
                      align-items: flex-start;
                      justify-content: flex-start;
                      font-size: 10px;
                      color: #64748b;
                    `}
                  >
                    <div
                      className={css`
                        position: relative;
                        font-weight: 500;
                      `}
                    >
                      Software Engineer
                    </div>
                  </div>
                </div>
                <div
                  className={css`
                    width: 235px;
                    margin: 0 !important;
                    position: absolute;
                    top: 72px;
                    left: 0px;
                    height: 33px;
                    display: flex;
                    flex-direction: column;
                    align-items: center;
                    justify-content: space-between;
                    z-index: 1;
                    font-size: 7px;
                  `}
                >
                  <div
                    className={css`
                      width: 188.76px;
                      position: relative;
                      height: 9px;
                      z-index: 1;
                    `}
                  >
                    <div
                      className={css`
                        position: absolute;
                        top: 0px;
                        left: 0px;
                        display: flex;
                        flex-direction: row;
                        align-items: flex-start;
                        justify-content: flex-start;
                        gap: 0px 8px;
                      `}
                    >
                      <address
                        className={css`
                          display: flex;
                          flex-direction: row;
                          align-items: center;
                          justify-content: flex-start;
                          gap: 0px 2px;
                          text-align: left;
                          font-size: 7px;
                          color: #334155;
                          font-family: "Plus Jakarta Sans";
                        `}
                      >
                        <img
                          className={css`
                            width: 5.76px;
                            position: relative;
                            height: 7px;
                          `}
                          alt=""
                          src="/mapicon.svg"
                        />
                        <div
                          className={css`
                            height: 9px;
                            display: flex;
                            flex-direction: row;
                            align-items: center;
                            justify-content: center;
                          `}
                        >
                          <div
                            className={css`
                              position: relative;
                              line-height: 11px;
                            `}
                          >
                            Lahore,Pakistan
                          </div>
                        </div>
                      </address>
                      <div
                        className={css`
                          display: flex;
                          flex-direction: row;
                          align-items: center;
                          justify-content: flex-start;
                          gap: 0px 2px;
                        `}
                      >
                        <img
                          className={css`
                            width: 7px;
                            position: relative;
                            height: 4.67px;
                            object-fit: cover;
